import React from 'react';
import { TextField, Typography } from '@material-ui/core';

const Filter = ({ onChangeHandler}) => (
   <>
  <Typography>Search contacts</Typography>
  <TextField
    id="filled-basic"
    onChange={onChangeHandler}
    label="Search"

  />
</>

);

export default Filter;
